import React, { Component,useState } from 'react'
import {ButtonGroup,Button,Radio} from '@material-ui/core'
import './SurveyContent.css'
class SurveyContent extends Component
{
    render()
    {

        return (

            <>
                <div className="questions">
                    <div className="q1">
                        <h1>Questions-1</h1>
                        <p>How old are you?</p>
                        <span>0-20</span>
                        <Radio onChange={onCHhangeHandle}
                               value="0-20"
                               checked={age === "0-20"}
                               disabled={disable}

                        />
                        <span>21-30</span>
                        <Radio value="21-30"
                               onChange={onCHhangeHandle}
                               checked={age === "21-30"}
                               disabled={disable}

                        />

                        <span>31-40</span>
                        <Radio value="31-40"
                               onChange={onCHhangeHandle}
                               checked={age === "31-40"}
                               disabled={disable}

                        />

                        <span>41-50</span>
                        <Radio value="41-50"
                               onChange={onCHhangeHandle}
                               checked={age === "41-50"}
                               disabled={disable}
                        />
                        <span>51-65</span>
                        <Radio value="51-65"
                               onChange={onCHhangeHandle}
                               checked={age === "51-65"}
                               disabled={disable}
                        />

                        <span>65+</span>
                        <Radio value="65+"
                               onChange={onCHhangeHandle}
                               checked={age === "65+"}
                               disabled={disable}
                        />

                    </div>


                    <h1><br/>Questions-2</h1>
                    <p>Select your gender</p>
                    <ButtonGroup variant="contained" color="primary">
                        <Button>Male</Button>
                        <Button>Female</Button>
                        <Button>Other</Button>

                    </ButtonGroup>
                    <h1><br/>Questions-3</h1>
                    <p>Please let us know what your current body temperature is </p>
                    <p>(Specify in Fahrenheit)</p>
                    <ButtonGroup variant="contained" color="primary">
                        <Button>Body temperature is normal at 96 ° F-98.6 ° F</Button>
                        <Button>Fever 98.6 F-102 F</Button>
                        <Button>High fever> 102 F</Button>
                        <Button>I don't know</Button>
                    </ButtonGroup>



                </div>


            </>
        )
    }
}

    export default SurveyContent;
